import React from 'react'
import { LevelCard } from '../components'

const School = ({school}) => {
  return (
    <div>
        {
            school.levels.map((level,idx) => (
                <div>
                    <LevelCard level={level}/>
                </div>
            ))
        }
    </div>
  )
}

export default School
